INSERT INTO `fournisseurs` VALUES (14315863504361,'L\'épice-riz','Pour de bonnes épices de saison. L\'épice de spécialité de cette petite coopérative s\'appelle le rian et est idéale pour agrémenter vos repas à base de riz !','','','','','','','','','',29894),(21337373812805,'Les pates de Patrick','','','','','','','','','','',29902),(23031412349984,'Ferme de la Motte','Producteur depuis 1967, la Ferme de la Motte est une entreprise 100% familiale, menée par la famille Lemaire. Aujourd’hui ce sont des frères et cousins qui se sont associés ensemble afin de perpétuer les valeurs de la famille. \\nInstallée sur ses terres en Beauce, au cœur du Val de Loire, la Ferme de la Motte fait partie des leaders français pour la fourniture de condiments frais conventionnels et bio (ail, oignon, échalote et échalion), et de pommes de terre bio sur les circuits de la grande distribution, des grossistes, de la restauration et de l’industrie. \\nElle compte parmi les 15 plus grands producteurs et conditionneurs d’oignons et de condiments en France. L’oignon est ainsi le produit phare de l’entreprise qui est en majeure partie produit sur ses terres.\\n La Ferme de la Motte s’est lancée dans l’agriculture biologique en 2003, avec une conversion de 80 Ha en culture Bio. Elle diversifie et développe ainsi son activité en Bio. \\nAujourd’hui elle occupe une place reconnue dans l’univers de l’industrie agro-alimentaire et est présente en grande distribution, chez des grossistes ou dans des réseaux 100% spécialisés Bio.\\nLa Ferme de la Motte est engagée de longue date dans une démarche de qualité et bénéficie des certifications IFS (dont les piliers sont la sécurité alimentaire et la traçabilité), et Globalgap (les bonnes pratiques agricoles).','','','https://www.fermedelamotte.com/fr/','100028127427225','','fermedelamotte','','','',15933),(24660421575385,'La tête dans les pommes','','','','','','','','','','',29900),(41813788624310,'Le sirop de Sissi','','','','','','','','','','',29903),(42822891275788,'Boulangerie GM','Notre boulangerie pâtisserie vous fait redécouvrir les pains, les pâtisseries et les viennoiseries fait exclusivement maison (Charte Boulanger de France). Nous utilisons des matières premières de qualité, tout en respectant la saisonnalité des fruits.\\n Venez vous rappeler ces saveurs :\\n Boulangerie : baguette, tradition, tradition graine, boule, pain de campagne, scandinave, pain de seigle, pain complet, pain aux maïs…\\n Pâtisserie : éclair, religieuse, gland, polonaise, mille-feuille, paris-brest, tarte citron meringuée, opéra…\\n Entremet : Le Royal, Le Rubis, La Douceur Poire, L’Exotique, Le Trois Chocolat, Le St Marc… \\n Traiteur : Petits fours salés et/ou sucrés, sandwich, pizza, tartine…\\n Evénementiel : Pièce Montée mariage et baptême\\n Et bien plus encore…\\n « La gourmandise est la source inépuisable de bonheur »','10 rue Notre-Dame','boulangerie-gm@orange.fr','https://boulangerie-gm.eatbu.com/','Boulangerie-GM-402736517161347','','','','','',16906),(58469406379761,'Le miel de Samuel','','','','','','','','','','',29901),(64030296678854,'Patisse-rit','','','','','','','','','','',29897),(64875158108142,'Le bon jambon','Eleveur de porc en région Centre. Vous trouverez tout type de viande, produit de qualité garanti !','','','','','','','','','',29895),(66883292738623,'Volaille en folie','','','','','','','','','','',29898),(90508132348361,'Chez mme confiture','Productrice amateure de Confiture, Muriel vous fournira ses confitures aux goûts aussi riches que variés.','','','','','','','','','',29896),(97667630154912,'Les bons œufs','','','','','','','','','','',29899);
